import Cards from './Cards';

function ContainerCards(){
    return(
        <div className='container'>
            <div className='containerCards'>
            <Cards />
            <Cards />
            <Cards />
            <Cards />
            <Cards />
            <Cards />
            <Cards />
            <Cards />
            </div>
        </div>
    )
}

export default ContainerCards;
